pragma solidity >=0.4.22 <0.7.0;

/*
    Organigr.am Contracts Framework - Organ library.
    This library holds the logic to manage a simple organ.
*/

library OrganLibrary {
    /*
        Entries are sets of addresses, contracts or documents.
    */
    struct Entry {
        address payable addr;           // Address if entry is account or a contract.
        bytes32 ipfsHash;               // ID of proposal on IPFS.
        uint8 hashFunction;
        uint8 hashSize;
    }

    struct OrganData {
        address owner;
        bytes32 metadataIpfsHash;
        uint8 metadataHashFunction;
        uint8 metadataHashSize;
        uint256 entriesCount;
        uint256 proceduresCount;
        Entry[] entries;
        address[] procedures;
        // Permissions are bits stored as :
        // {canAddProcedure}{canRemoveProcedure}00{canAddEntry}{canRemoveEntry}{canWithdraw}{canDeposit}
        mapping(address => uint8) permissions;
        mapping(address => uint256) addressIndexInEntries;
        mapping(address => uint256) addressIndexInProcedures;
    }

    /*
        Modifiers
    */
    modifier onlyOwner(OrganData storage self) {
        require(self.owner == msg.sender, "Not authorized.");
        _;
    }
    modifier canAddProcedure(OrganData storage self) {
        require(self.permissions[msg.sender] & 0x80 == 0x80, "Not authorized.");
        _;
    }
    modifier canRemoveProcedure(OrganData storage self) {
        require(self.permissions[msg.sender] & 0x40 == 0x40, "Not authorized.");
        _;
    }
    modifier canAddEntry(OrganData storage self) {
        require(self.permissions[msg.sender] & 0x08 == 0x08, "Not authorized.");
        _;
    }
    modifier canRemoveEntry(OrganData storage self) {
        require(self.permissions[msg.sender] & 0x04 == 0x04, "Not authorized.");
        _;
    }
    modifier canWithdraw(OrganData storage self) {
        require(self.permissions[msg.sender] & 0x02 == 0x02, "Not authorized.");
        _;
    }
    modifier canDeposit(OrganData storage self) {
        require(self.permissions[msg.sender] & 0x01 == 0x01, "Not authorized.");
        _;
    }

    /*
        Events.
    */

    event metadataUpdated(address from, bytes32 ipfsHash, uint8 hashFunction, uint8 hashSize);
    event fundsWithdrawn(address from, address to, uint256 amount);
    event fundsDeposited(address from, uint256 amount);
    event procedureAdded(address from, address procedure, uint8 permissions);
    event procedureRemoved(address from, address procedure);
    event entryAdded(address from, uint256 index, address addr, bytes32 ipfsHash, uint8 hashFunction, uint8 hashSize);
    event entryRemoved(address from, uint256 index);

    /*
        Constructor.
    */

    function init(
        OrganData storage self, address owner,
        bytes32 ipfsHash, uint8 hashFunction, uint8 hashSize
    )
        public
    {
        // Initializing with deployer as master.
        self.owner = owner;
        self.permissions[owner] = 0xC0; // Can add and remove procedures.
        self.procedures.push(owner);
        self.addressIndexInProcedures[owner] = self.procedures.length - 1;
        self.proceduresCount++;
        // Initializing metadata.
        self.metadataIpfsHash = ipfsHash;
        self.metadataHashFunction = hashFunction;
        self.metadataHashSize = hashSize;

        // @TODO : Check if necessary.
        Entry memory initEntry;
        self.entries.push(initEntry);
    }

    // Only an address who can add and remove procedures can update metadata.
    function updateMetadata(
        OrganData storage self,
        bytes32 ipfsHash, uint8 hashFunction, uint8 hashSize
    )
        public canAddProcedure(self) canRemoveProcedure(self)
    {
        self.metadataIpfsHash = ipfsHash;
        self.metadataHashFunction = hashFunction;
        self.metadataHashSize = hashSize;
        emit metadataUpdated(msg.sender, ipfsHash, hashFunction, hashSize);
    }

    /*
        Funds management.
    */

    function deposit(OrganData storage self)
        public canDeposit(self)
    {
        emit fundsDeposited(msg.sender, msg.value);
    }

    function withdraw(OrganData storage self, address payable to, uint value)
        public canWithdraw(self)
    {
        to.transfer(value);
        emit fundsWithdrawn(msg.sender, to, value);
    }

    /*
        Procedures management.
    */

    function addProcedure(OrganData storage self, address procedure, uint8 permissions)
        public canAddProcedure(self) returns (uint256 index)
    {
        // Check new procedure is not already there.
        require(self.permissions[procedure] == 0, "Duplicate record.");
        // Check new procedure has permissions.
        require(permissions > 0, "Wrong permissions set.");

        // Store procedures.
        self.permissions[procedure] = permissions;
        index = self.addressIndexInProcedures[procedure];
        if (index == 0) {
            self.procedures.push(procedure);
            index = self.procedures.length - 1;
            self.proceduresCount++;
        }
        emit procedureAdded(msg.sender, procedure, permissions);
        return index;
    }

    function removeProcedure(OrganData storage self, address procedure)
        public canRemoveProcedure(self)
    {
        // Check procedure is already there.
        require(self.permissions[procedure] > 0, "Record not found.");

        uint256 index = self.addressIndexInProcedures[procedure];
        delete self.procedures[index];
        self.addressIndexInProcedures[procedure] = 0;
        self.proceduresCount--;
        emit procedureRemoved(msg.sender, procedure);
    }

    function replaceProcedure (
        OrganData storage self, address oldProcedure, address newProcedure,
        uint8 permissions
    )
        public canAddProcedure(self) canRemoveProcedure(self)
    {
        // Check old procedure will be removable before adding.
        require(self.permissions[oldProcedure] > 0, "Record not found.");
        // Check new procedure has permissions.
        require(permissions > 0, "Wrong permissions set.");

        // Check if we are replacing a master with another, or updating permissions.
        if (oldProcedure != newProcedure) {
            addProcedure(self, newProcedure, permissions);
            removeProcedure(self, oldProcedure);
        }
        else {
            // Update permissions.
            self.permissions[newProcedure] = permissions;
            // Trigger events.
            emit procedureRemoved(msg.sender, oldProcedure);
            emit procedureAdded(msg.sender, newProcedure, permissions);
        }
    }

    /**
        Entries management.
    */

    function addEntry(
        OrganData storage self, address payable addr,
        bytes32 ipfsHash, uint8 hashFunction, uint8 hashSize
    )
        public canAddEntry(self) returns (uint index)
    {
        // If the entry has an address, we check that the address has not been used before.
        if (addr != address(0)) {
            require(self.addressIndexInEntries[addr] == 0, "Duplicate record.");
        }
        // Adding the entry.
        self.entries.push(Entry({
            addr: addr,
            ipfsHash: ipfsHash,
            hashFunction: hashFunction,
            hashSize: hashSize
        }));
        // Registering entry position relative to its address.
        index = self.entries.length - 1;
        self.addressIndexInEntries[addr] = index;
        // Incrementing entries counter.
        self.entriesCount++;
        emit entryAdded(msg.sender, index, addr,  ipfsHash,  hashFunction,  hashSize);
        // Registering the address as active
        return index;
    }

    function removeEntry(OrganData storage self, uint index)
        public
    {
        // Check sender is allowed:
        // - Sender is admin.
        // - Entry number is trying to delete itself.
        // @TODO : Should an entry really be able to delete itself?
        Entry memory entry = self.entries[index];
        require(
            (self.permissions[msg.sender] & 0x04 == 0x04) || entry.addr == msg.sender,
            "Not authorized."
        );
        // Removing entry from entries.
        delete self.entries[index];
        self.entriesCount--;
        // Deleting entry index.
        self.addressIndexInEntries[entry.addr] = 0;
        // Logging event.
        emit entryRemoved(msg.sender, index);
    }

    function replaceEntry(
        OrganData storage self, uint index, address payable addr,
        bytes32 ipfsHash, uint8 hashFunction, uint8 hashSize
    )
        public canAddEntry(self) canRemoveEntry(self)
    {
        // Check that the replacing address is not registered.
        if (addr != address(0)) {
            require(self.addressIndexInEntries[addr] > 0, "Record not found.");
        }
        self.addressIndexInEntries[self.entries[index].addr] = 0;
        emit entryRemoved(msg.sender, index);

        self.entries[index] = Entry({
            addr: addr,
            ipfsHash: ipfsHash,
            hashFunction: hashFunction,
            hashSize: hashSize
        });

        self.addressIndexInEntries[addr] = index;
        emit entryAdded(msg.sender, index,  addr, ipfsHash,  hashFunction,  hashSize);
    }
}
